import React from 'react'
import data from './data'
import "./menu.css"

const Menu = () => {
  return (
    <div className='menu'>
      {
          data.map((onedata,index)=>{
            const {name_folder,id} = onedata
            return<div key={id}>
              <button className='btn'>{name_folder}</button>
            </div>
          })
        }
        <button className='add'>Add</button>
    </div>
  )
}

export default Menu
